    color:#4D4ABF;
    font-family: 'NanumSquareOTF', sans-serif;
    font-weight: 800;
    font-size: 1.875em;
`;

const Item = styled.div`
  color:${ props => props.click ? '#4D4ABF': '#FB8500'};
  font-family: 'NanumSquareOTF', sans-serif;
  font-weight: 700;
  font-size: 1.375em;
`

const Category = () => {
    return (
      <div>
        <Title>Category</Title>
        <Item>전공</Item>
      </div>
    );
  };


export default Category;
